import { useState } from "react";

function App() {

  function fnSubmit(e) {//arrow펑션은 내장함수쓸때 많이 쓰고 내가 만드는 하무는 이런식으로 많이 사용함
    e.preventDefault()
  }

  return (
    <>
      <h3>구구단연습</h3>
      <form onSubmit={fnSubmit}>
        <input type="number" min="0" max="9" readOnly />
        *
        <input type="number" min="0" max="9" readOnly />
        =
        <input type="number" min="0" max="99" />
      </form>
    </>
  );
}

export default App;
